import React from 'react'

const footer = () => {
  return (
    <div>
    <footer style={{"display":"flex","paddingTop":"500px"}}>
      <button>Add Terms and Conditions</button>
      <button>Add Notes</button>
      <button>Add Attachments</button>
      <button>Add Additional Info</button>
      <button>Add Contact Details</button>
      </footer>
    </div>
  )
}

export default footer;
